import AdminNavbar from "./adminnavbar";
import { useNavigate, useParams } from "react-router";
import { useEffect, useState } from "react";
import { Button, Card, Row, Container, Col } from "react-bootstrap";
import axios from "axios";
import { Link } from "react-router-dom";
import UpdateComponent from "./update";

function AdminDashboard() {
  const navigate = useNavigate('');
  const [book, setBook] = useState([]);
  const [customer, setCustomer] = useState([]);
  const [customerBook, setCustomerBook] = useState([]);

  const [delBook, setDelBook] = useState([]);
  
  const handleAllCustomers=()=>{
    axios.get('http://localhost:8182/customer/getall')
    .then(response => setCustomer(response.data));
  }
  const handleAllCustomerBooks=()=>{
    axios.get('http://localhost:8182/customerBook/getall')
    .then(response => setCustomerBook(response.data));

  }

    useEffect(() => {
    axios.get('http://localhost:8182/Book/all')
      .then(response => setBook(response.data));
  }, []);
  const handleDelete = (bookId) => {
    console.log('Deleting book with ID:', bookId);
  
    axios.delete(`http://localhost:8182/Book/delete/${bookId}`)
      .then(response => {
        console.log( response.data);
        setDelBook(response.data);
      })
      .catch(error => {
        console.error('Error deleting book:', error);
      });
  };
  return (
    <div>
      <AdminNavbar />
      <Container className="mt-5">
        <h1 className="text-center">Admin Dashboard</h1>
        <Button onClick={handleAllCustomers}>GetALlCustomers</Button>
        <Button onClick={handleAllCustomerBooks}>GetALlBookings</Button>

        <Row className="justify-content-md-center">
          <Col className="col-md-3 mb-3">
          {book.map((b, index) => (
            <div key={index} className="col-md-4 mb-4">
              <Card style={{ width: '400px', border: '1px solid #dee2e6', borderRadius: '0.25rem' }}>
                <Card.Body>
                  <Link to={`/books?id=${b.id}`}>
                    <Card.Title>{b.bookTitle}</Card.Title>
                  </Link>
                  <hr />
                  <div>
                    <div style={{ display: 'flex', flexDirection: 'column', marginBottom: '10px' }}>
                      <div>
                        <span style={{ fontWeight: 'bold' }}>Rating:</span> {b.rating}
                      </div>
                      <div>
                        <span style={{ fontWeight: 'bold' }}>Author:</span>
                        <Link to={`/authors?id=${b.id}`}>
                          {b.author}
                        </Link>
                      </div>
                      <div>
                        <span style={{ fontWeight: 'bold' }}>Price:</span> {b.bookPrice}
                      </div>
                    </div>
                    <Button onClick={() => navigate(`/admin/update/${b.id}`)} style={{ width: 200, alignSelf: "center", margin: 15 }} variant="outline-primary">
                      UPDATE
                    </Button>
                    <Button onClick={() => handleDelete(b.id)} style={{ width: 200, alignSelf: "center", margin: 15 }} variant="outline-primary">
                      DELETE
                    </Button>

                  </div>
                </Card.Body>
              </Card>
            </div>
          ))}
          </Col>
        
        <Col className="col-md-3 mb-3">
          {customer.map((c, index) => (
            <div key={index} className="col-md-4 mb-4">
              <Card style={{ width: '400px', border: '1px solid #dee2e6', borderRadius: '0.25rem' }}>
                <Card.Body>
                  
                    <Card.Title>{c.name}</Card.Title>
                  
                  <hr />
                  <div>
                    <div style={{ display: 'flex', flexDirection: 'column', marginBottom: '10px' }}>
                      <div>
                        <span style={{ fontWeight: 'bold' }}>Contact:</span> {c.contact}
                      </div>
                      </div>
                  </div>
                </Card.Body>
              </Card>
            </div>
          ))}
          </Col>
          <Col className="col-md-3 mb-3">
          {customerBook.map((cb, index) => (
            <div key={index} className="col-md-4 mb-4">
              <Card style={{ width: '400px', border: '1px solid #dee2e6', borderRadius: '0.25rem' }}>
                <Card.Body>
                  
                    <Card.Title>{cb.fine}</Card.Title>
                  
                  <hr />
                  <div>
                    <div style={{ display: 'flex', flexDirection: 'column', marginBottom: '10px' }}>
                      <div>
                        <span style={{ fontWeight: 'bold' }}>Contact:</span> {c.issueDate}
                      </div>
                      </div>
                  </div>
                </Card.Body>
              </Card>
            </div>
          ))}
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default AdminDashboard;
